1. DOMAINESDE FORMATION
ITCo, étant un apporteur de solution, s’est engagé depuis sa création dans divers domaines de formation et de travail. Nous faisons des formations Professionnelles continues, des formations Professionnelles à la carte et des formations Professionnelles personnalisées.
- Dans les études, ITCo vous offre un panel de prestation à savoir :
• La mise à niveau des PME, PME, EMF etc ;
• Le montage des projets de développement ;
• La réalisation des business plan ;
• Les restructurations des entreprises …. etc ;
• Le suivi et l’évaluation des projets.
- Dans l’accompagnement
• L’assistance au recrutement ;
• L’assistance comptable ;
• Organisation des séminaires de formation ;
• Organisation des réunions, des ateliers de formation ;
• Location des salles avec vidéo- projecteur.
 
- Dans la Formation
Nous accompagnons les administrations publiques, les entreprises privées et les particuliers dans la réalisation de leurs projets et de leurs objectifs.  A cet effet, nous recyclons et formons dans les domaines suivants :
• Gestion des ressources humaines ;
• Organisation et gestion des entreprises ;  
• Gouvernance des finances publiques ;
• Finance/comptabilité ;
• Management ;
• Outils de la GPEC et de leur exploitation des états financiers ;
• Audit ;
• Comprendre la loi de finance ;
• Cybercriminalité ;
• Sécurité informatique ;
• Gestion et gouvernance locale ;
• Gestion administrative : bureautique, MICROSOFT OFFICE 2013, EXCEL, ACCES ;
• Management du tourisme dans les communes ;
• Comptabilité informatisée ;
• Gestionnaire TPE/PME/PMI ;
• Audit et Contrôle de Gestion.

• La Librairie-Papeterie ITCo est un établissement commercial spécialisé dans la vente de fournitures de bureaux et autres consommables, située dans la même enceinte au lieu-dit « Ancienne Mairie Tsinga»
Nous pouvons fournir des produits tels que :
- Ecriture et correction (Stylo bleu, noir, rouge, vert / Bic Crystal et Schneider, Taille crayon et gommes maped, Crayons, Marqueurs, Surligneurs, Feutres, Craies, Correcteurs Bic et diluant) ;
- Enveloppes (A3 paquets de 50 ; A4 paquets de 50 ; A5: couleur blanche et kaki A6) ;
- Petites fournitures (Agrafes, Agrafeuse GM et PM, perforer, Colle & scotch, Reliures / titreuses, Tampons & Dateurs, Badges, Découpes, Outils de mesure, plumier) ;
- Classement (Classeurs, Chronos, Intercalaires, Chemises & sous-chemises, Boîte à Archives, Protège et Porte documents, Trieurs, Parapheurs, paniers à courriers) ;
- Cahiers & agendas (Blocs notes, bloc éphémérides post-it, Cahiers, Carnets & Répertoires, Agendas / Calendriers, Registres, Manifolds, Feuilles) ;
- Rame de papier (Malmero, bristole, papier glacés, papier de lux et transparent) ;
- Cartouches (Canon, hp) ;
- Carton de Rames de papier (A3, A4) 70 et 80 grammes.
La liste étant exhaustive nous ne pouvons tout énumérer dans cette offre.

